create database economico;
use economico;

CREATE TABLE socio_economico (
    Id				INT UNSIGNED NOT NULL auto_increment PRIMARY KEY,
    Nome			VARCHAR(255),
    Idade			INT,
    Genero			VARCHAR(255),
    Escolaridade	VARCHAR(255),
    Ocupacao		VARCHAR(255),
    Renda_Mensal	VARCHAR(255),
    Estado_Civil	VARCHAR(255),
    Estado			VARCHAR(255),
    Cidade			VARCHAR(255)
);

